import React from 'react';
import { HashRouter as Router, Route, Switch } from 'react-router-dom'; // Corrected import

import ''
import NavBar from './Components/Layouts/NavBar';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import DashBoard from './Components/Layouts/DashBoard';

import backgroundImage from './pattern.png';
import Pokemon from './Components/pokemon/Pokemon';

function App() {
  return (
    <Router>
      <div className="App" style={{ background: `url(${backgroundImage})` }}>
        <NavBar />
        <div className='container'>
          <Switch> {/* Corrected typo from "switch" to "Switch" */}
            <Route exact path="/" component={DashBoard} /> {/* Corrected typo from "Router" to "Route" */}
            <Route exact path="/pokemon/:pokemonIndex" component={Pokemon} /> {/* Corrected typo from "Router" to "Route" */}
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
